// PropertyManagementPage.jsx
import React, { useState } from 'react';

const PropertyManagementPage = () => {
    const [formData, setFormData] = useState({
        user_id: '', // You may retrieve this from the user's session or authentication
        image_url: '',
        title: '',
        description: '',
        address: '',
        city: '',
        state: '',
        zip_code: '',
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Send the listing data to the server for creation
        // You can use the fetch API or an HTTP library like Axios
    };

    return (
        <div>
            <h2>Property Management</h2>
            <form onSubmit={handleSubmit}>
                <div>
                    <label htmlFor="image_url">Image URL:</label>
                    <input
                        type="url"
                        id="image_url"
                        name="image_url"
                        value={formData.image_url}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="title">Title:</label>
                    <input
                        type="text"
                        id="title"
                        name="title"
                        value={formData.title}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="description">Description:</label>
                    <textarea
                        id="description"
                        name="description"
                        value={formData.description}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="address">Address:</label>
                    <input
                        type="text"
                        id="address"
                        name="address"
                        value={formData.address}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="city">City:</label>
                    <input
                        type="text"
                        id="city"
                        name="city"
                        value={formData.city}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="state">State:</label>
                    <input
                        type="text"
                        id="state"
                        name="state"
                        value={formData.state}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="zip_code">ZIP Code:</label>
                    <input
                        type="text"
                        id="zip_code"
                        name="zip_code"
                        value={formData.zip_code}
                        onChange={handleChange}
                        required
                    />
                </div>
                <button type="submit">Submit Listing</button>
            </form>
        </div>
    );
};

export default PropertyManagementPage;
